import React, { useState, useEffect } from 'react'
import { Nav, Navbar, NavbarBrand, NavbarNav, NavbarToggler, NavItem, NavLink, NavDropdown, Container } from 'react-bootstrap';
import './topBar.css';

const TopBar = () => {
  const [weather, setWeather] = useState({});

  useEffect(() => {
    fetch(
      `https://weather.visualcrossing.com/VisualCrossingWebServices/rest/services/timeline/Allentown%2C%20PA?unitGroup=us&key=9STJKDTHMUJ8FT23YSZHW5D7K&contentType=json`
    )
      .then((res) => res.json())
      .then((data) => {
        console.log(data);
      });
  }, []);

  return (
    <div>
      <Navbar bg="light" expand="lg">
        <Container>
          <Navbar.Brand>Lehigh Valley Tourism Bureau</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="me-auto">
              <NavDropdown title="Weather in the Lehigh Valley!" id="basic-nav-dropdown">
                <NavDropdown.Item>{weather.currentConditions.temp}</NavDropdown.Item>
              </NavDropdown>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    </div>
  );
}

export default TopBar;
